import React from 'react';

const Weather = (props) => {
        console.log(props.weather)
        return(
            {weather(){
                if(props.weather !== undefined){
                    return(
                        <>
                       <h1>Date: {props.weather.applicable_date}</h1>
                       <h>Maximum Temperature :{props.weather.max_temp}</h>
                        </>
                    )}
                  else{
                      return (<p>Enter a Location Name</p>);
                  }
                }   
            }
        )
}

export default Weather;
